import React, { Component } from "react";
import { HashRouter as Router, Route, Link, NavLink } from "react-router-dom";
import SignUpForm from "./pages/SignUpForm";
import SignInForm from "./pages/SignInForm";
import Modal from 'react-bootstrap/Modal';
import { Form, Button, FormGroup, FormControl, ControlLabel, Col, Nav, Navbar, useState} from "react-bootstrap";
import Popup from "reactjs-popup";

export default class HomeComponent extends Component {
  render() {
    return (
      <div className="HomeComponent">
        <Router>
            <Example/>
            <Example1/>
            {/*<Switch>
                            <Route path="/" exact component={FooterComponent}/>
                            <Route path="/SignUpForm" component={SignUpComponent}/>
                            <Route path="/welcome/:name" component={WelcomeComponent}/>
                            <Route path="/logout" component={LogoutComponent}/>
                            <Route path="/SignInForm" component={SignInForm.SignInComponent}/>
                            <Route component={ErrorComponent}/>
                        </Switch>*/}
            <FooterComponent />
        </Router>
      </div>
    );
  }
}


function Example() {
  const [show, setShow] = React.useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <Button variant="primary" onClick={handleShow}>
        Login
      </Button>

      <Button variant="primary" onClick={handleShow}>
        Signup
      </Button>

      <Modal show={show} onHide={handleClose}>
      <Form>
          <Form.Group controlId="formBasicEmail">
            <Form.Label>Email address</Form.Label>
            <Form.Control type="email" placeholder="Enter email" />
            <Form.Text className="text-muted">
              We'll never share your email with anyone else.
            </Form.Text>
          </Form.Group>

          <Form.Group controlId="formBasicPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" />
          </Form.Group>
          <Form.Group controlId="formBasicCheckbox">
            <Form.Check type="checkbox" label="Check me out" />
          </Form.Group>
          <Button variant="primary" type="submit" onClick={handleClose}>
            Submit
          </Button>
        </Form>
      </Modal>
    </>
  );
}


